VALUES ('3350031988240', 'Tuiles Goût Paprika', 'Pomme de terre déshydratée 47%, matière grasse végétale de palme (dont acidifiant : acide citrique), amidons (blé et pomme de terre), sirop de glucose de blé, assaisonnement aromatisé (sel, chapelure (farine de blé, sel, poudre à lever : carbonates d\'ammonium), dextrose, exhausteurs de goût : monoglutamate de sodium (E621), guanylate disodique, inosinate disodique, poudre d\'oignon, arôme (contient du lait), épices (paprika et poivre blanc), anti-agglomérants : sels de magnésium d\'acides gras, dioxyde de silicium, poudre d\'ail, poudre de tomate, extrait de levure, acidifiant : acide citrique, extraits de paprika et de romarin (huile de tournesol), arôme de fumée), huile de colza, émulsifiant : mono- et diglycérides d\'acides gras, sel.', 'https://static.openfoodfacts.org/images/products/335/003/198/8240/front.12.400.jpg', '28', '2.5', '62', '4.3', '3.5', '4.7', '0.1', '0.0393700787401575', '', '0');

